package net.onlineshop.services.front.orderdetail.bean;import java.io.Serializable;import net.onlineshop.services.front.account.impl.ImageUtils;public class Orderdetail extends net.onlineshop.services.common.Orderdetail implements Serializable {	private static final long serialVersionUID = 1L;	public void clear() {		super.clear();	}	private String picurl160;	private String picurl400;	public String getPicurl160() {		if (this.getPicurl() != null && !"".equals(this.getPicurl())) {			picurl160 = ImageUtils.replaceLast(this.getPicurl(),"_3", "_1");		}		return picurl160;	}	public void setPicurl160(String picurl160) {		this.picurl160 = picurl160;	}	public String getPicurl400() {		if (this.getPicurl() != null && !"".equals(this.getPicurl())) {			picurl400 = ImageUtils.replaceLast(this.getPicurl(),"_3", "_2");		}		return picurl400;	}	public void setPicurl400(String picurl400) {		this.picurl400 = picurl400;	}}